import React from "react"

const ImageGalleryItem = ({ hits: { id, webformatURL, largeImageUR, tags } }) => {
  const fullImage = () => onImageClick(largeImageUR)
  return (<li key={id} className="gallery-item">
  <img src={webformatURL} alt={tags} onClick={fullImage} />
</li>) 
}

export default ImageGalleryItem
